import React from 'react';

const About: React.FC = () => {
    return (
        <div className="about-container">
            <h1>About Us</h1>
            <p>
                Welcome to our application! We aim to provide the best service for our users.
                Our team is dedicated to ensuring a seamless experience and continuous improvement.
            </p>
            <h2>Our Mission</h2>
            <p>
                Our mission is to empower users with the tools they need to succeed and to foster a community of collaboration and support.
            </p>
            <h2>Contact Us</h2>
            <p>
                If you have any questions or feedback, feel free to reach out to us through our contact page.
            </p>
        </div>
    );
};

export default About;
